// ==UserScript==
// @name		    Change YouTube Grid
// @version		    1.0.0
// @description     Change the number of videos per row on YouTube, after the latest change of displaying only 3 videos.
// @match           *://www.youtube.com/*
// @run-at		    document-end

// @copyright     2025, MSerj
// @license       MIT
// @namespace     https://greasyfork.org/en/users/1321619-mserj
// @icon data:image/png;base64,

// @grant               GM_registerMenuCommand
// @grant               GM_addStyle
// @downloadURL https://update.greasyfork.org/scripts/534516/Change%20YouTube%20Grid.user.js
// @updateURL https://update.greasyfork.org/scripts/534516/Change%20YouTube%20Grid.meta.js
// ==/UserScript==

/* jshint esversion: 11 */

;(() => {
	'use strict'
	const CONFIG = {
		columns: 'ytd-items-per-row',
		portraitColumns: 'ytd-portrait-columns'
	}
	const state = {
		columns: Math.min(10, Math.max(1, parseInt(localStorage.getItem(CONFIG.columns)) || 5)),
		portraitColumns: parseInt(localStorage.getItem(CONFIG.portraitColumns)) || null
	}
	const handleResize = () => {
		if (state.portraitColumns !== null) {
			const { innerWidth: width, innerHeight: height } = window
			const original = Math.min(10, Math.max(1, parseInt(localStorage.getItem(CONFIG.columns)) || 5))
			state.columns = width > height ? original : state.portraitColumns
		}
		updateStyle()
	}
	const updateStyle = () => {
		GM_addStyle(`
            .style-scope.ytd-two-column-browse-results-renderer {
                --ytd-rich-grid-items-per-row: ${state.columns} !important;
                --ytd-rich-grid-gutter-margin: 0px !important;
            }
        `)
	}
	GM_registerMenuCommand(' Set the number of displays per line', () => {
		const input = prompt('Please enter the number of videos displayed per line (1-10):', state.columns)
		if (input === null) return
		const value = Math.min(10, Math.max(1, parseInt(input) || state.columns))
		localStorage.setItem(CONFIG.columns, value)
		state.columns = value
		handleResize()
		alert(`Current settings: ${value} videos are displayed per line`)
	})
	GM_registerMenuCommand(' Perpendicular display quantity', () => {
		const input = prompt(
			`Set the number of displays on the vertical screen (1-10, current: ${state.portraitColumns || 'Not set'}):`,
			state.portraitColumns || 3
		)
		if (input === null) return
		const value = Math.min(10, Math.max(1, parseInt(input) || 3))
		localStorage.setItem(CONFIG.portraitColumns, value)
		state.portraitColumns = value
		handleResize()
		alert(`Current settings for the vertical screen: ${value} videos are displayed per line`)
	})
	if (state.portraitColumns !== null) {
		GM_registerMenuCommand('Clear the vertical screen settings', () => {
			if (!confirm('Are you sure you want to clear the vertical screen settings?')) return
			localStorage.removeItem(CONFIG.portraitColumns)
			state.portraitColumns = null
			state.columns = Math.min(10, Math.max(1, parseInt(localStorage.getItem(CONFIG.columns)) || 5))
			updateStyle()
			alert('Vertical screen settings have been cleared')
		})
	}
	window.addEventListener('resize', handleResize)
	handleResize()
})()
